カダン 除草王 オールキラー粒剤 400g<br>ブランド：カダン 除草王シリーズ<br>販売・製造元：フマキラー<br><br>手軽にまける粒タイプの除草剤です。<br>約6ヶ月の長期持続効果で、年1回の散布でも除草力を発揮。<br>ヨモギ、ススキ、セイタカアワダチソウ、スギナや20cm程度伸びた雑草、しつこいササにも有効です。<br>薬剤が表面近くに保持され発芽抑制効果も期待できます。<br>家のまわり、駐車場、道路、空地、墓地などの除草に。<br>約3-6坪(10-20平方メートル)に使用できます。<br> <br>成分カルブチレート(3-(3.3-ジメチルウレイド)フェニル=ターシャリーブチルカルバマート)2.0%、鉱物質微粉等98%性状：類白色細粒 適用雑草と<br><br>使用方法<br>*印は本剤およびカルブチレートを含む農薬を、年間に同一場所で使用できる総使用回数の制限を表示します。<br>作物名適用場所適用雑草名使用時期1平方m当りの使用量総使用回数*本剤のみカルブチレート樹木等宅地駐車場道路等1年生雑草及び多年生広葉雑草雑草生育初期20-40g2回2回多年生イネ科雑草40-60gササ類雑草生育期40-50g●使い方：植栽地を除く樹木等の周辺地に全面土壌散布 効果・薬害等の注意●対象雑草の土壌表面に均一に散布する。<br>●雑草の群生している場所に局所使用する場合には、散布面積の割合に応じて使用量を減ずる。<br>●本剤は遅効性なので効果の発現までに時間を要するが再散布はしない。<br>●他の農作物に薬害を生じる恐れがあるので付近に農作物がある場合には、飛散流入等ないよう充分注意する。<br>●植栽地を除く樹木等の周辺地で使用する場合は、薬剤が樹木等の植栽地に流入または飛散するおそれのある場所等では使用しない。<br>また、樹木等有用植物の根が分布していると思われるところでは使用を避ける。<br>●本剤の使用に当たっては使用量、使用時期、<br><br>使用方法<br>などを誤らないように注意する。<br>●激しい降雨の予想される場合は、使用を避ける。<br>●本剤が、水槽、池、河川等に飛散、流入しないよう十分に注意する。<br>●有効年月内に使用する。<br> 安全<br><br>使用上の注意<br>●散布の際は農薬用マスク、手袋、長ズホン、長袖の作業衣などを着用する。<br>作業後は手足、顔などを石けんでよく洗い、うがいをする。<br>●かぶれやすい体質の人は取扱いに注意する。<br>●宅地、駐車場等で使用する場合は、散布中及び散布後(少なくとも散布当日)に小児や散布に関係のない物が散布区域に立ち入らないよう縄囲いや立て札を立てるなど配慮し、人畜等に被害を及ぼさないよう注意を払う。<br>●散布器具、容器の洗浄水は河川等に流さず、容器、空袋等は環境に影響を与えないよう適切に処理する。<br>●使用残りの薬剤は必ず安全な場所に保管する。<br>●体調の悪い時、妊娠中、飲食後等は使用しない。<br>●魚毒性：通常の<br><br>使用方法<br>では問題ない。<br>●保管：直射日光を避け、食品(飲食物)やペットの餌と区別して、なるべく低温で乾燥した場所に密封して保管する。<br>子供の手の届かない場所に保管する。<br> 上手な使い方●すべての植物に作用しますので、花壇、芝生、畑、水田などの付近や、飛散、流入のおそれのある所では絶対に使用しないでください。<br>●樹木など有用植物の根が分布していると思われる所から2m以上離して使用してください。<br>●地面にまいた薬剤が根から雑草に吸収され、効果が現れるまで約2-3週間かかります。<br>その後は約3-6ヶ月間効果が持続します。<br>*散布する環境(時期、天候、場所、雑草の種類)によって効力に差が出る場合があります。<br>●雨上がりの使用が最も効果的です。<br>地面が乾燥している時は、ジョウロなどで水をまいてからお使いください。<br>●雑草が大きくなる前の散布がより効果的です。<br> <br>DIY・ガーデン／ガーデニング／除草剤／除草剤 粒剤<br>JANコード： 4902424426069<br><br>CS：30<br><br>【除草剤＆動物進入禁止】<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
