カダン 除草王 ザッソージエース 1L<br>ブランド：カダン 除草王シリーズ<br>販売・製造元：フマキラー<br><br>散布しやすいシャワータイプの除草剤です。<br>圧倒的な浸透力で、まいた当日に雨が降っても効き目そのまま(まいてから2時間以降の雨)。<br>薬剤は根から吸収されないので、庭木周辺にも散布できます。<br>土中でもすぐに分解されるので、まいた後で植物を植えることもできます。<br>スギナにも効きます。<br> <br>成分グリホサートカリウム塩(カリウム：N-(ホスホノメチル)グリシナート)0.86%界面活性剤・水等99.14%●性状：淡青色澄明液体 <br><br>使用方法<br>植裁地を除く樹木等の周辺地に雑草茎葉散布 適用雑草       作物名    適用場所    適用雑草名    使用期間    使用量    総使用回数         本剤のみ    グリホサート         樹木等    公園、庭園、堤とう、駐車場、道路、鉄道、運動場、宅地、のり面等    一年生雑草      多年生雑草    雑草生育期      (草丈50cm以下)    25-50ml/平方メートル      (原液散布)    3回    3回         スギナ    雑草生育期      (草丈20-30cm)          100ml/平方メートル        (原液散布)         効果・薬害等の注意・本剤はグリホサートを含む農薬であるので、他のグリホサートを含む農薬の使用回数と合わせ、総使用回数の範囲内で使用する。<br>・本剤は土壌中で不活性化するので雑草発生前に散布しても効果はない。<br>・激しい降雨の予想される場合は使用を避ける。<br>・本剤は通常数日から2週間で効果が発現し、効果完成までさらに日数を要するので、誤って再散布しない。<br>・本剤は、植物に薬液が付着すると薬害が生じるので、散布液が付近の農作物、樹木の茎葉に飛散しないよう散布する。<br>・スギナを防除する場合は、スギナの生育を過ぎた時期での散布は効果が劣ることがあるので、適期に散布するように留意する。<br>・容器の洗浄水及び残りの薬液は河川等に流さず、空容器等は環境に影響を与えないよう適切に処理する。<br>・有効年月内に使用する。<br> 安全<br><br>使用上の注意<br>・誤飲などのないように注意する。<br>・散布の際は、農薬用マスク、手袋、長ズボン、長袖の作業衣などを着用する。<br>作業後は手足、顔などを石けんでよく洗い、うがいをする。<br>・かぶれやすいの体質の人は取扱いに十分注意する。<br>・公園、堤とう等で使用する場合は、散布中及び散布後(少なくとも散布当日)に小児や散布に関係ない者が散布区域に立ち入らないよう縄囲や立て札を立てるなど配慮し、人畜等に被害を及ぼさないよう注意を払う。<br>・使用残りの薬剤は必ず安全な場所に保管する。<br>・人に向かって散布しない。<br>・体調の悪い時、妊娠中、飲酒後等は取扱い及び作業をしない。<br> 保管上の注意・直射日光をさけ、低温で乾燥した凍結のおそれのない場所に密栓して保管する。<br>・飲食物、食器類、ペットのえさと区別し、小児の手の届かない所に保管してください。<br> 廃棄方法使用後の容器はプラスチックゴミとして捨てる。<br> <br>DIY・ガーデン／ガーデニング／除草剤／除草剤 液剤<br>JANコード： 4902424425505<br><br>CS：15<br><br>【除草剤＆動物進入禁止】<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
